    id_text_web_access: ["Access rights and parental controls", "Käyttöoikeudet ja lapsilukko", "Användarrättigheter och föräldrakontroll", "Zugriffsrechte und Kindersicherung", "Droits d'accès et contrôle parental", "Toegangsrechten en kinderslot", "Kasutusõigused ja lapselukk", "Brugerrettigheder og børnesikring", "Zasady dostępu i kontrola rodzicielska", "Piekļuves tiesības un vecāku kontrole", "Prieigos teisės ir apsaugos nuo vaikų valdymas", "Přístupová práva a rodičovská kontrola", "Prístupové práva a rodičovská kontrola", "Права доступа и родительский контроль"],
    id_text_web_very_limited_1: ["The user can change the ventilation mode and view the ventilation unit information.", "Käyttäjä voi vaihtaa ilmanvaihdon tilaa ja tarkastella ilmanvaihtokoneen tietoja.", "Användaren kan ändra ventilationsprofilen och granska aggregatets uppgifter.", "Der Benutzer kann den Lüftungsmodus wechseln und Gerätedaten ansehen.", "L'utilisateur peut modifier le mode de ventilation et consulter les infos sur ce mode.", "Gebruikers kunnen de ventilatiemodus aanpassen en de gegevens van het ventilatietoestel bekijken.", "Kasutaja saab muuta ventilatsioonirežiimi ja vaadata ventilatsiooniseadme andmeid.", "Bruger kan ændre ventilationsmodus og få vist ventilationsaggregatets oplysninger.", "Użytkownik może zmienić obecny profil wentylacji i sprawdzić szczegółowe informacje urządzenia.", "Lietotājs var mainīt ventilācijas režīmu un apskatīt informāciju par ventilācijas iekārtu.", "Naudotojas gali keisti vėdinimo režimą ir peržiūrėti vėdinimo įrenginio informaciją.", "Uživatel může změnit režim ventilace a zobrazit informace o ventilační jednotce.", "Užívateľ môže zmeniť režim ventilácie a zobraziť informácie o ventilačnej jednotke.", "Пользователь может изменить режим работы вентиляционной установки и просмотреть ее данные."],
    id_text_web_very_limited_2: ["However, the user cannot edit most of the settings.", "Käyttäjä ei kuitenkaan voi muokata järjestelmän asetuksia.", "Användaren kan dock inte ändra systeminställningarna.", "Der Benutzer kann jedoch keine Systemeinstellungen bearbeiten.", "Toutefois, la plupart des paramètres ne peuvent être modifiés par l'utilisateur", "Gebruikers kunnen echter de meeste instellingen niet aanpassen", "Kasutaja ei saa siiski muuta kõiki seadeid.", "Bruger kan ikke ændre systemindstillinger.", "Jednak nie może on edytować większości ustawień.", "Taču lietotājs nevar rediģēt lielāko daļu iestatījumu.", "Tačiau naudotojas negali redaguoti daugelio nuostatų.", "Uživatel však nemůže upravit většinu nastavení.", "Užívateľ však nemôže upravovať väčšinu nastavení.", "В то же время пользователь не сможет редактировать большую часть рабочих параметров."],
    id_text_web_limited_1: ["The user can view the information of the ventilation unit and edit some of its settings. ", "Käyttäjä voi tarkastella ilmanvaihtokoneen tietoja ja muokata sen asetuksia rajoitetusti.", "Användaren kan granska och ändra ventilationsaggregatets grundinställningar.", "Der Benutzer kann die Daten des Lüftungsgeräts ansehen und einige Einstellungen ändern. ", "L'utilisateur peut afficher et modifier les réglages de base de l'appareil de ventilation.", "Gebruikers kunnen de gegevens van het ventilatietoestel bekijken en een aantal instellingen aanpassen. ", "Kasutaja saab vaadata ventilatsiooniseadme andmeid ja muuta mõningaid seadeid.", "Bruger kan få vist ventilationsaggregatets oplysninger og redigere nogle af indstillingerne. ", "Użytkownik może zobaczyć i edytować podstawowe funkcje urządzenia wentylacyjnego.", "Lietotājs var apskatīt informāciju par ventilācijas iekartu un mainīt daļu no tās iestatījumiem.", "Naudotojas gali peržiūrėti vėdinimo įrenginio informaciją ir redaguoti kai kurias jo nuostatas.", "Uživatel může zobrazit informace o ventilační jednotce a upravit některá její nastavení. ", "Užívateľ môže prezerať informácie o ventilačnej jednotke a upravovať niektoré z jej nastavení. ", "Пользователь может просматривать информацию о вентиляционной установке и менять некоторые ее настройки. "],
    id_text_web_limited_2: ["Access to expert settings is restricted.", "Pääsyä erikoisasetuksiin on rajoitettu.", "Tillträde till specialinställningarna är begränsad.", "Der Zugriff auf die speziellen Einstellungen ist gesperrt.", "Accès aux réglages expert est bloqué.", "Geavanceerde instellingen zijn beperkt toegankelijk.", "Ligipääs eriseadetele on keelatud.", "Adgang til avancerede indstillinger er begrænset.", "Dostęp do ustawień specjalistycznych jest zablokowany.", "Piekļuve specializētajiem iestatījumiem ir ierobežota.", "Prieiga prie eksperto nuostatų yra apribota.", "Přístup k pokročilým nastavením je omezen.", "Prístup k odborným nastaveniam je obmedzený.", "Доступ к настройкам для опытных пользователей ограничен."],
