    id_text_web_network_error: ["Network error. Check your network connection and reload the webpage. If the error persists, reboot the ventilation unit", "Verkkoyhteysvirhe. Tarkista verkkoyhteys ja päivitä web-sivu. Jos virhe ei häviä, käynnistä ilmanvaihtokone uudelleen.", "Nätverksfel. Kontrollera nätanslutningen och uppdatera webbsidan. Om felet kvarstår, starta ventilationsaggregatet på nytt.", "Netzwerkfehler. Netzwerkverbindung überprüfen und Webseite aktualisieren. Wenn der Fehler weiterhin auftritt, Lüftungsgerät neu starten.", "Erreur de réseau. Veuillez vérifier la connexion réseau et recharger la page. Si le problème persiste, redémarrer l'appareil de ventilation.", "Netwerkfout. Controleer uw netwerkverbinding en laad de pagina opnieuw. Als de fout blijft optreden, start het ventilatietoestel dan opnieuw op.", "Võrgutõrge. Kontrollige võrguühendust ja laadige lehekülg uuesti. Kui tõrge püsib, taaskäivitage ventilatsiooniseade.", "Netværksfejl. Kontroller netværksforbindelsen og genindlæs hjemmesiden. Hvis fejlen vedvarer, genstartes ventilationsaggregatet.", "Wystąpił błąd sieci. Sprawdź połączenie sieciowe i przeładuj stronę. Jeżeli błąd będzie się powtarzać  uruchom urządzenie wentylacyjne ponownie.", "Tīkla kļūda. Pārbaudiet tīkla savienojumu un pārlādējiet vietni. Ja kļūda joprojām pastāv, restartējiet ventilācijas iekārtu", "Įvyko tinklo klaida. Patikrinkite savo tinklo ryšį ir iš naujo įkelkite puslapį. Jeigu problema išlieka, paleiskite vėdinimo įrenginį iš naujo ", "Chyba sítě. Zkontrolujte připojení k síti a znovu načtěte webovou stránku. Pokud chyba přetrvává, ventilační jednotku restartujte", "Chyba siete. Skontrolujte sieťové pripojenie a znova načítajte webovú stránku. Ak chyba pretrváva, reštartujte ventilačnú jednotku", "Ошибка сети. Проверьте сетевое подключение и перезагрузите веб-страницу. Если проблема сохраняется, перезагрузите вентиляционную установку."],
