    id_text_web_reboot_device: ["Configuration has been changed. Turn the ventilation unit off for a little while and reboot.", "Konfiguraatio on muuttunut. Katkaise virta hetkeksi ja käynnistä kone uudelleen.", "Konfigurationen har ändrats. Slå av strömmen för en stund och starta sedan aggregatet på nytt.", "Die Konfiguration wurde geändert. Schalten Sie das Lüftungsgerät kurz aus und dann wieder ein.", "La configuration a été modifiée. Veuillez éteindre l'appareil pendant quelques instants et le redémarrer.", "De configuratie is gewijzigd. Schakel het ventilatietoestel enige tijd uit en start het opnieuw op.", "Konfiguratsioon on muutunud. Lülitage ventilatsiooniseade natukeseks ajaks välja ja taaskäivitage.", "Konfigurationen er ændret. Sluk kortvarigt for ventilationsaggregatet og genstart det.", "Konfiguracja została zmieniona. Zrestartuj urządzenie porzez wyłączenie go a następnie ponowne uruchomienie.", "Konfigurācija tika mainīta. Uz īsu brīdi izslēdziet ventilācijas iekārtu un restartējiet to.", "Konfigūracija buvo pakeista. Vėdinimo įrenginį išjunkite, šiek tiek palaukite ir paleiskite jį iš naujo.", "Konfigurace byla změněna. Na chvíli vypněte ventilační jednotku a restartujte ji.", "Konfigurácia bola zmenená. Ventilačnú jednotku na chvíľu vypnite a reštartujte.", "Конфигурация была изменена. На некоторое время выключите вентиляционную установку, а затем перезагрузите ее."],
