    id_text_web_ip_address_change: ["The ventilation unit will reboot after configuration. The IP address of the unit may change. ", "Ilmanvaihtokone käynnistyy uudelleen konfiguroinnin jälkeen. Laitteen IP-osoite saattaa muuttua.", "Ventilationsaggregatet startar om efter konfigurationen. Aggregatets IP-adress kan ändras.", "Das Lüftungsgerät startet nach der Konfiguration neu. Möglicherweise ändert sich die IP-Adresse des Geräts. ", "L'appareil redémarrera après configuration. L'adresse IP de l'appareil peut changer.", "Na configuratie start het toestel opnieuw op. Mogelijk verandert het IP-adres van het toestel. ", "Pärast konfigureerimist ventilatsiooniseade taaskäivitub. Seadme IP-aadress võib muutuda. ", "Ventilationsaggregatet vil genstarte efter konfigurationen. IP-adressen kan være ændret. ", "Urządzenie wentylacyjne uruchomi się ponownie po konfiguracji. Jego adres IP może ulec zmianie.", "Pēc konfigurēšanas ventilācijas iekārta tiks restartēta. Iekārtas IP adrese var mainīties.", "Po konfigūravimo vėdinimo įrenginys bus paleistas iš naujo. Gali pasikeisti įrenginio IP adresas. ", "Ventilační jednotka se po konfiguraci restartuje. Může se změnit IP adresa jednotky. ", "Ventilačná jednotka sa po konfigurácii reštartuje. IP adresa jednotky sa môže zmeniť. ", "После изменения конфигурации будет выполнена перезагрузка вентиляционной установки. IP-адрес установки может измениться. "],
